import React from 'react';
import { motion } from 'framer-motion';
import Navbar from '../../components/Navbar';
import Footer from '../../components/Footer';
import { useLanguage } from '../../context/LanguageContext';
import ModernHero from './ModernHero';
import OurServices from './OurServices';
import OurWorks from './OurWorks';
import './IndexPage.css';

const IndexPage = () => {
    const { t } = useLanguage();

    return (
        <div className="index-page">
            <Navbar indexPage={true} />
            <main>
                <ModernHero />
                <OurWorks />
                <OurServices />

                {/* Why Choose Us Section */}
                <motion.section 
                    className="why-choose-us"
                    initial={{ opacity: 0, y: 50 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.8 }}
                    viewport={{ once: true }}
                >
                    <div className="pattern-overlay"></div>
                    <div className="gradient-overlay"></div>
                    
                    <div className="container">
                        <div className="section-header">
                            <div className="badge">Why Choose Us</div>
                            <h2>{t('whyChooseUs')}</h2>
                            <p>Experience excellence in every detail</p>
                        </div>
                        
                        <div className="features-grid">
                            <motion.div 
                                className="feature"
                                whileHover={{ y: -10 }}
                                transition={{ duration: 0.3 }}
                            >
                                <div className="feature-icon">
                                    <i className="fas fa-award"></i>
                                </div>
                                <h3>{t('expertTeam')}</h3>
                                <p>{t('expertTeamDesc')}</p>
                            </motion.div>
                            <motion.div 
                                className="feature"
                                whileHover={{ y: -10 }}
                                transition={{ duration: 0.3 }}
                            >
                                <div className="feature-icon">
                                    <i className="fas fa-spray-can"></i>
                                </div>
                                <h3>{t('premiumProducts')}</h3>
                                <p>{t('premiumProductsDesc')}</p>
                            </motion.div>
                            <motion.div 
                                className="feature"
                                whileHover={{ y: -10 }}
                                transition={{ duration: 0.3 }}
                            >
                                <div className="feature-icon">
                                    <i className="fas fa-clock"></i>
                                </div>
                                <h3>{t('timelyService')}</h3>
                                <p>{t('timelyServiceDesc')}</p>
                            </motion.div>
                            <motion.div 
                                className="feature"
                                whileHover={{ y: -10 }}
                                transition={{ duration: 0.3 }}
                            >
                                <div className="feature-icon">
                                    <i className="fas fa-shield-alt"></i>
                                </div>
                                <h3>{t('satisfaction')}</h3>
                                <p>{t('satisfactionDesc')}</p>
                            </motion.div>
                        </div>
                    </div>
                </motion.section>
            </main>
            <Footer />
        </div>
    );
};

export default IndexPage;
